import React, { useState } from 'react';
import Navbar from '../../components/Common/Navbar';
import LogoutButton from '../../components/Common/LogoutButton';
import UserInfo from '../../components/Common/UserInfo';
import axios from 'axios';

const TaskFormPage = () => {
  // 입력 필드를 위한 상태 관리
  const [name, setName] = useState('');
  const [taskType, setTaskType] = useState('');
  const [robotId, setRobotId] = useState('');
  const [status, setStatus] = useState('Pending'); // 기본값 'Pending'
  const [message, setMessage] = useState('');
  const [isLoading, setIsLoading] = useState(false); // 로딩 상태 추가

  // 작업 생성 API 요청
  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true); // 요청 시작 시 로딩 상태로 설정

    const token = localStorage.getItem('token'); // 인증 토큰 가져오기

    if (!token) {
      alert('No token found, please log in again.');
      setIsLoading(false); // 로딩 상태 해제
      return;
    }

    const taskData = {
      name,
      taskType,
      robotId,
      status
    };

    try {
      // API 호출을 통해 작업 생성 요청
      await axios.post('http://172.30.1.28:6000/task/create', taskData, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });
      setMessage({ type: 'success', text: 'Task created successfully!' });
      setName('');
      setTaskType('');
      setRobotId('');
      setStatus('Pending'); // 기본 상태로 리셋
    } catch (error) {
      setMessage({ type: 'error', text: 'Failed to create task.' });
      console.error('Error creating task:', error);
    }
    setIsLoading(false); // 요청 완료 후 로딩 상태 해제
  };

  return (
    <div style={{ fontFamily: 'Arial, sans-serif', margin: '20px' }}>
      <header style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '20px' }}>
        <UserInfo />
        <LogoutButton />
      </header>
      <div style={{ display: 'flex' }}>
        <Navbar />
      </div>
      <h2 style={{ textAlign: 'center', margin: '20px 0' }}>Create New Task</h2>
      <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <input
          type="text"
          placeholder="Task Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
          style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
        />
        <select
          value={taskType}
          onChange={(e) => setTaskType(e.target.value)}
          required
          style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
        >
          <option value="" disabled>Select Task Type</option>
          <option value="Cleaning">Cleaning</option>
          <option value="Transport">Transport</option>
          <option value="Inspection">Inspection</option>
        </select>
        <input
          type="text"
          placeholder="Robot ID"
          value={robotId}
          onChange={(e) => setRobotId(e.target.value)}
          required
          style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
        />
        <select value={status} onChange={(e) => setStatus(e.target.value)} style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}>
          <option value="Pending">Pending</option>
          <option value="In Progress">In Progress</option>
          <option value="Completed">Completed</option>
          <option value="Failed">Failed</option>
        </select>
        <button type="submit" disabled={isLoading} style={{ padding: '10px 20px', borderRadius: '5px', backgroundColor: '#4CAF50', color: '#fff', border: 'none', cursor: 'pointer' }}>
          {isLoading ? 'Creating Task...' : 'Create Task'}
        </button>
      </form>
      {message && (
        <p style={{ color: message.type === 'error' ? 'red' : 'green' }}>
          {message.text}
        </p>
      )}
    </div>
  );
};

export default TaskFormPage;
